Operação “Bom Caminho”

A GNR inicia a Operação “Bom Caminho”, que decorrerá até ao dia 31 de dezembro de 2022, com o objetivo de promover a visibilidade e o patrulhamento de proximidade da Guarda, na proteção e segurança dos peregrinos que se deslocam a Santiago de Compostela e que transitam ao longo do Caminho Português, do Caminho Português da Costa e do Caminho Português Interior, através dos Comandos Territoriais do Porto, Braga, Viana do Castelo, Vila Real e Viseu.

A Guarda irá manter um conjunto de atividades operacionais que contribuem para o sentimento de segurança e a visibilidade junto dos peregrinos, nos diferentes percursos.

Assim, pretende-se reforçar a presença na Guarda nos locais mais vulneráveis à passagem dos peregrinos, através de patrulhamento específico e ações de sensibilização, tendo em vista transmitir os principais conselhos de segurança:

• Planeie/prepare o percurso antecipadamente;
• Evite desviar-se do percurso;
• Caminhe apenas nos períodos diurnos;
• Utilize roupas claras e material retrorrefletor;
• No trajeto circule pelos passeios ou na ausência pelas bermas;
• Em grupo, caminhe em fila única;
• Mantenha o telemóvel com bateria e o contacto diário com a família;
• Não utilize auscultadores durante o caminho e evite o transporte de grandes quantidades de dinheiro;
• Nos albergues não deixe bens/dinheiro ao alcance de terceiros;
• Desloque-se sempre munido de documento de identificação (cartão de cidadão/passaporte e cartão europeu de saúde).

Adicionalmente, nos períodos de maior afluência de peregrinos, em particular na Semana Santa e no período do Verão, realizar-se-ão patrulhas conjuntas com a Guardia Civil.

