Problema de recolha de lixos e monos no concelho de Aljezur

A CDU, através da sua eleita na Assembleia Municipal, e no seguimento do requerimento nº. 9, de 21/12/2021, levantou a preocupante questão da acumulação de lixo e monos em vários pontos do concelho de Aljezur.
É visível a degradação do serviço de recolha de lixos no nosso concelho!
Os exemplos são vários, seja em Odeceixe, Aljezur, Alfambras ou mesmo no Vale da Telha. A imagem que passa do nosso concelho é de desleixo!
Em pleno Parque Natural, esta questão deveria ser prioritária, mas não tem sido.
A CDU para além de levantar esta questão, sugeriu à câmara algumas medidas para minimizar este problema:
Colocar estruturas para depósito de "monos" em lugares estratégicos no concelho;
Enviar comunicação aos munícipes, com informação de locais de depósito e dias de recolha deste tipo de lixos;
Mais regularidade a recolha de lixo por todo o concelho;
A câmara dar o exemplo, pela positiva, ao não deixar restos de obras e outro tipo de lixos, como o que tem acontecido, como é exemplo disso a zona dos Malhadais;
Exigir da empresa que recolhe o lixo no concelho, que cumpra com o contratado no que concerne à regularidade do serviço;
Exigir da empresa da recolha de lixos diferenciados, a colocação de mais ecopontos.
A CDU irá acompanhar este assunto!

--

Abraços,
Sofia Magalhães Costa

